import React from "react";
import Navbar from "./navbar";
import "./products.css"
import Image from "./Images/sunscream.png"


function ViewProducts(){
    return(
        <div id="product-page">
        <div id="product-desc">
        <h2>Minimalist Sunscream (50 SPF)</h2>
            <a>
                <a>Rs 249/-</a>
                <a>Rating 4/5</a>

            </a>
            <p>A light weight, moisturiser-meets-sunscreen. This broad spectrum SPF 50 with PA++++ rating, 
                has a very light texture that spreads easily & disappears leaving behind a natural, moisturised,
                 non-shiny look. Loaded with Vitamins A, B, E & F that help repair skin and minimise damage caused 
                 by UV exposure.</p>
            <center><button>Add to cart</button></center>   
        </div>
        <div id="product-image">
            <img src={Image} />
            </div>
        </div>

    )
}



export default function Products(){
    return(
        <div>
            <Navbar />
            <ViewProducts />

        </div>
    )
}
